tables.table_schema:
CREATE TABLE cross_docking_delays (
  delay_id SERIAL PRIMARY KEY,
  shipment_id INT NOT NULL,
  delay_reason TEXT,
  delay_duration INT
);

CREATE TABLE bottlenecks (
  bottleneck_id SERIAL PRIMARY KEY,
  bottleneck_type TEXT,
  description TEXT,
  resolve_date DATE
);

CREATE TABLE processes (
  process_id SERIAL PRIMARY KEY,
  process_name TEXT,
  start_time TIME,
  end_time TIME
);

CREATE TABLE inefficiencies (
  inefficiency_id SERIAL PRIMARY KEY,
  process_id INT NOT NULL,
  inefficiency_type TEXT,
  inefficiency_description TEXT
);

CREATE TABLE solutions (
  solution_id SERIAL PRIMARY KEY,
  bottleneck_id INT NOT NULL,
  solution_description TEXT,
  implemented BOOLEAN
);
